import { FC } from "react";
import styled from "styled-components";
import { fonts, titlleFont } from "../../styledHelpers/Fonts";

const MainDiv = styled.div`
  width: 100%;
  height: 100%;
  margin-left: 50px;
  margin-top: 20px;
`;
const CorporateDiv = styled.div`
margin-left:15px;
  height: 200px;
  width: 860px;
  background-color: white;
  margin-top: 50px;
  box-shadow: 2px 2px 4px 2px #a3a3a381;
  border-radius: 5px;
`;
const CorporateImage = styled.img``;
const SettingsIcon = styled.img`
  float: right;
  margin-top: 9px;
  height: 20px;
  width: auto;
  padding-right: 25px;
`;
const CorporateLabel = styled.label`
  float: left;
  padding-top: 10px;
  padding-left: 100px;
  font-size: 20px;
`;
const EntityIcon1 = styled.img`
  height: 50px;
  margin-top:-15px;
  margin-left: 28px;
`;
const MidDiv = styled.div`
  height: 30px;
  background-color: white;
`;

const Label = styled.div`
position:relative  ;
margin-left:100px;
margin-top:-33px;
`;
const SliderDiv = styled.div`
background-color:wheat;
width:890px;
height:230px;
margin-top:20px;
display: flex;
`;
const Box= styled.div`
height:150px;
width:240px;
background-color:red;
margin-top:30px;
margin-left:43px;
`;

export const Workspace: FC = () => {
  return (
    <MainDiv>
      <CorporateDiv>
        <CorporateImage src="/media/images/office.jpg" />
        <CorporateLabel> Corporate Holdings </CorporateLabel>
        <MidDiv>
          <SettingsIcon src="/media/icons/settings2.png" />
        </MidDiv>
        <EntityIcon1 src="/media/icons/entities2.png" />
        <Label>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
            eiusmod tempor incididunt ut labore et dolore magna aliqua.</Label>
      </CorporateDiv>
      <SliderDiv>
        <Box></Box>
        <Box></Box>
        <Box></Box>
      </SliderDiv>
    </MainDiv>
  );
};
